import React from 'react';
import './Rank.css'

const Rank = ({name, entries}) =>{
    return(
        <div>
            <div className="rankText">
                {`${name}, your number of searches are ...`}
            </div>
            <div className="rankValue">
                {entries}
            </div>
        </div>
    );
}
export default Rank;
